import React from "react";
import Draggable from "react-draggable";
import { Card } from "react-bootstrap";

export const Rectangle = () => {
  return (
    <Draggable>
      <Card className="mb-2">
        <Card.Body className="text-center"></Card.Body>
      </Card>
    </Draggable>
  );
};
